Women aged 30 years or older, those with complications during pregnancy and those with a gestational age over 40 weeks have been shown to have an increased risk of post-partum disseminated intravascular coagulation. In addition, these factors may further increase the risk associated with labor induction (see 
                        ADVERSE REACTIONS
                     ). Therefore, in these women, use of dinoprostone should be undertaken with caution. Measures should be applied to detect as soon as possible an evolving fibrinolysis in the immediate post-partum phase.
